import style from'./App.module.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Main from './components/Main/Main';
import Support from './components/Support/Support';
import Footer from './components/Footer/Footer';
import {BrowserRouter, Route,Routes} from 'react-router-dom';

function App(props) {
  let goodsData = [
    { id: 1, goodsname: "Смартфон", goodsdiscripion: "Эргономичный и удобный телефон, который отлично подойдет для повседневных звонков" },
    { id: 2, goodsname: "Наушники", goodsdiscripion: "Классные проводные наушники затычки" },
];
  return (
    <BrowserRouter>
      <div>
        <div className={style.appwrapper}>
          <Header />
          <Navbar />
          <Routes>
          <Route path="/main" element={<Main goodsData = {props.goodsData}/>}/>
          <Route path="/support/*" element={<Support messagesData = {props.messagesData} ticketsData = {props.ticketsData}/>}/>
          </Routes>
          <Footer />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
